    return (
        <div className="flex justify-center mt-36 max-h-1/2">
            <div>
                <div>
                    <img src={imageUrl} alt="" className="rounded" width={'500px'} height={'auto'} />
                </div>
                {/* color container */}
                <div className="flex justify-between mt-5 h-10">
                    {/* colors */}
                    <div style={{backgroundColor: colors[0]}} className="w-1/6 rounded">f</div>
                    <div style={{backgroundColor: colors[1]}} className="w-1/6 rounded"></div>
                    <div style={{backgroundColor: colors[2]}} className="w-1/6 rounded"></div>
                    <div style={{backgroundColor: colors[3]}} className="w-1/6 rounded"></div>
                    <div style={{backgroundColor: colors[4]}} className="w-1/6 rounded"></div>

                </div>
            </div>
        </div>
    )
}


export default ColorDetection;
